import java.io.*;
import java.util.*;

public class SubmitFile {
    static BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
    static StringTokenizer st;
    public static void main(String[] args) throws Exception{
        // TODO code application logic here
        NN nn = new NN(784,8,10);
        // int n=readInt();
        // for(int i=0;i<n; i++){
        //     float a[]=new float[784];
        //     for(int j=0; j<28; j++){
        //         for(int k=0; k<28; k++){
        //             a[j*28+k]=readFloat();
        //         }
        //     }
        //     float b[]=nn.feedForward(a);
        //     int ans=0;
        //     for(int j=0; j<10; j++){
        //         if(b[j]>b[ans])ans=j;
        //     }
        //     System.out.println(ans);
        // }
        DataInputStream dataInputStream = new DataInputStream(new BufferedInputStream(new FileInputStream("t10k-images.idx3-ubyte")));
        int magicNumber = dataInputStream.readInt();
        int numberOfItems = dataInputStream.readInt();
        int nRows = dataInputStream.readInt();
        int nCols = dataInputStream.readInt();
        System.out.println("number of items is " + numberOfItems);
        DataInputStream labelInputStream = new DataInputStream(new BufferedInputStream(new FileInputStream("t10k-labels.idx1-ubyte")));
        int labelMagicNumber = labelInputStream.readInt();
        int numberOfLabels = labelInputStream.readInt();
        System.out.println("number of labels is: " + numberOfLabels);
        int accuracy=0;
        for(int i = 1; i < numberOfItems; i++) {
            float[] input = new float[nRows*nCols];
            for (int r = 0; r < nRows; r++) {
                for (int c = 0; c < nCols; c++) {
                    int t=dataInputStream.readUnsignedByte();
                    //System.out.println(t);
                    input[r*nCols+c]=(float)(t/255.0);
                }
            }
            float[] result=nn.feedForward(input);
            int ans=0;
            for(int j=0; j<10; j++){
                if(result[j]>result[ans])ans=j;
            }
            int label=labelInputStream.readUnsignedByte();
            if(ans==label)accuracy++;
            System.out.println(accuracy*100.0/10000+" "+ans+" "+label);
        }
        dataInputStream.close();
        labelInputStream.close();
    }


    static String next () throws IOException {
        if (st == null || !st.hasMoreTokens())
            st = new StringTokenizer(br.readLine());
        return st.nextToken();
    }
    static int readInt() throws IOException {
         return Integer.parseInt(next());
    }

    static float readFloat() throws IOException {
         return Float.parseFloat(next());
    }
}
